import React from 'react';
import { Card } from 'antd';
import './App.css';

class CurrencyCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            buy: 0.0,
            sell: 0.0
          };
      }

    componentDidMount() {
        const req = new Request("http://localhost:8080/getgemini?currencyType="+this.props.type, {
            method: 'GET',
            cache: 'default'
          });
    fetch(req,
    {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }

      })
      .then((response) => {
          response.clone().json()
        }
          )
      .then((btc) => {
          console.log(btc);
        })

    }

    render() {
        const { buy, sell } = this.state

            return (
            <div className="App">
                <header className="App-header">
                <Card title={this.props.title}>
                    <p>
                    <br />
                        <b>{this.props.type}:</b>

                        <br />
                            <b>BUY:</b>{buy} 

                            <br />
                            <b>SELL:</b>{sell}

                    </p>
                </Card>
                </header>
            </div>
            );
            }
    }

export default CurrencyCard;
